import { useEffect, useState } from "react";

export const useFetchMoviesId = (movieId: any) => {
  const [movie, setMovie] = useState<IMovies>();
  console.log("%cuseFetchMoviesId.ts line:5 movieId", "color: #26bfa5;", movieId);

  useEffect(() => {
    fetch(`https://my-json-server.typicode.com/cristianmeelo/cinetag-api/movies?=${movieId}`).then((response) => response.json());
    // .then((data) => setMovie(...data));
  }, [movieId]);

  return { movie };
};
